import { Routes, useNavigate } from 'react-router-dom';
import ContactList from './ContactList';

function Dashbord() {
    let isLogin = true
    const navigate = useNavigate()
    useEffect(() => {
        if (isLogin) {
        }
        else {
            navigate('/login')
            return
        }
    }, [isLogin])
    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Button variant="success">Dashbord</Button>
                    <Nav className="me-auto">
                        <Button className='mx-4' variant="info">Studets</Button>
                        <Button variant="warning">Create Contact</Button>
                    </Nav>
                </Container>
            </Navbar>
           <ContactList/>
        </>
    );
}

export default Dashbord;
